BEGIN TRANSACTION;
DROP TABLE IF EXISTS clientes;
DROP TABLE IF EXISTS eventos;
DROP TABLE IF EXISTS compras;
DROP TABLE IF EXISTS contatos;
CREATE TABLE clientes (id INTEGER PRIMARY KEY AUTOINCREMENT, nome TEXT NOT NULL, telefone TEXT, email TEXT, created_at TEXT, cpf TEXT, cpf_normalizado TEXT, genero TEXT, data_nascimento TEXT, aceita_contato INTEGER DEFAULT 0, tipo_usuario TEXT, usuario_id TEXT, estado_cliente TEXT, interesses TEXT, updated_at TEXT);
CREATE TABLE eventos (id INTEGER PRIMARY KEY AUTOINCREMENT, data TEXT NOT NULL, titulo TEXT NOT NULL, descricao TEXT, cor TEXT, cliente_id INTEGER, completed INTEGER NOT NULL DEFAULT 0, created_at TEXT, updated_at TEXT, usuario_id TEXT);
CREATE TABLE compras (id INTEGER PRIMARY KEY AUTOINCREMENT, cliente_id INTEGER NOT NULL, data TEXT NOT NULL, armacao TEXT, material_armacao TEXT, valor_armacao REAL, lente TEXT, valor_lente REAL, nota_fiscal TEXT, detalhe_compra TEXT, oe_esferico TEXT, oe_cilindrico TEXT, oe_eixo TEXT, oe_dnp TEXT, oe_adicao TEXT, od_esferico TEXT, od_cilindrico TEXT, od_eixo TEXT, od_dnp TEXT, od_adicao TEXT, created_at TEXT NOT NULL, updated_at TEXT NOT NULL);
CREATE TABLE contatos (id INTEGER PRIMARY KEY AUTOINCREMENT, cliente_id INTEGER NOT NULL, compra_id INTEGER, data_compra TEXT, data_contato TEXT NOT NULL, prazo_meses INTEGER NOT NULL, efetuado INTEGER NOT NULL DEFAULT 0, efetuado_em TEXT, created_at TEXT NOT NULL, updated_at TEXT NOT NULL);
COMMIT;
